const background = '#563D7C';
const color= 'white';

const MyStyle = {
    primary_color: {
        background,
    },
    
    col_border: {
        // border: `5px solid ${primary_color}`,
        border: '1px solid white',
        background: `${primary_color}`,
        // borderRadius: '20%',
        color: 'white',
    },
    border_right: {
        borderRight: `5px solid ${primary_color}`,
        paddingRight: '2px',
    },
    search_box: {
        width: '75%',
        flex: '7',
        border: `2px solid ${primary_color}`,
        // borderBottom: `2px solid ${primary_color}`,
        margin: '2px 2.5px 1px 1.2px',
    },
    search_btn: {
        background: `${ primary_color }`,
        flex: '1',
        border: 'none',
        color: 'white',
        width: '20%',
        float: 'right',
    }

}

export default MyStyle;
